type Error struct {
	Message  string
	Location *Location
	Level    ErrorLevel
	Type     ErrorType
}

func NewError(
	message string,
	location *Location,
	level ErrorLevel,
	errType ErrorType,
) *Error {
	return &Error{
		Message:  message,
		Location: location,
		Level:    level,
		Type:     errType,
	}
}
